import getYouTubeID from "get-youtube-id";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import YouTube from "react-youtube"
import { updateUrl } from "./redux/reducers/activeUrlReducer";

const Players = () => {
    const song = useSelector((state) => state.activeUrl.value)
    const songList = useSelector((state) => state.songStore.value)
    const dispatch = useDispatch()
    useEffect(() => {
    //   var t = setTimeout(function(){
    //     var iframe = document.getElementById('spotifyPlayer') || false;
    //     var innerDoc = iframe.contentDocument || iframe.contentWindow.document;
    //     console.log(innerDoc)
    //     // if (button) {
    //     //     console.log('Click', button)
    //     //     button.click()
    //     // }
    // }, 999)
  });

    if(song.source === false){
    const opts = {
        height: '390',
        width: '640',
        playerVars: {
          // https://developers.google.com/youtube/player_parameters
          autoplay: 1,
        },
      };
    return(<div>
        <YouTube videoId={getYouTubeID(song.url)} opts={opts} onEnd={()=>loadNextSong(songList, dispatch)} />
        
        </div>)
    }else{

      
    return(<div><iframe id="spotifyPlayer" style={{borderRadius:"12px"}} src={"https://open.spotify.com/embed/track/" + song.url.match('(?<=\\/).{22}(?=\\?)') + "?utm_source=generator"} width="100%" height="380" frameBorder="0" allowFullScreen="" autoPlay="1" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"></iframe></div>)


    //
    }
}
const loadNextSong = (songList, dispatch) =>{
    const randomSong = songList[Math.floor(Math.random() * songList.length)]
    dispatch(updateUrl({url:randomSong.url, source: randomSong.source}))

}



 export default Players
